CREATE DATABASE  IF NOT EXISTS `database` ;
USE `database`;


DROP TABLE IF EXISTS `clist`;

CREATE TABLE `clist` (
  `c_id` int(11) NOT NULL AUTO_INCREMENT,
  `city` varchar(100) NOT NULL,
